			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "###########################################################################\n# ðŸª¶ Sentry dSYM Upload Script\n# This script uploads dSYM (debug symbol) files to Sentry automatically\n# so that crash reports can be symbolicated (show readable stack traces).\n# Also add this line to the \"Input Files\" section of the script:\n#   ${DWARF_DSYM_FOLDER_PATH}/${DWARF_DSYM_FILE_NAME}/Contents/Resources/DWARF/${EXECUTABLE_NAME}\n#\n# Never commit your SENTRY_AUTH_TOKEN to version control.\n\n#Also:\n# 1: Yoiu need to install Sentry CLI on host machine in order to bellow script to run\n###########################################################################\n\n# ðŸ§± 1. Skip script for Debug and Simulator builds\n#    - We only upload symbols for Release builds (those used in production or TestFlight).\nif [ \"$CONFIGURATION\" != \"Release\" ] || [ \"$EFFECTIVE_PLATFORM_NAME\" == \"-iphonesimulator\" ]; then\n    echo \"â„¹ï¸  Skipping Sentry dSYM upload for $CONFIGURATION $EFFECTIVE_PLATFORM_NAME build\"\n    exit 0\nfi\n\n# ðŸ§  2. Update PATH for Apple Silicon (arm64) Macs\n#    - Homebrew installs binaries in /opt/homebrew/bin on Apple Silicon (M1/M2/M3 chips)\n#    - This ensures Xcode can find sentry-cli.\nif [[ \"$(uname -m)\" == arm64 ]]; then\n    export PATH=\"/opt/homebrew/bin:$PATH\"\nfi\n\n# ðŸª¶ 3. Check if sentry-cli is available\n#    - sentry-cli is the command-line tool used to upload debug symbols.\nif which sentry-cli >/dev/null; then\nexport SENTRY_ORG=freelance-6m\nexport SENTRY_PROJECT=swift-bestapp\nexport SENTRY_AUTH_TOKEN=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\n\n# ðŸ§© 4. Upload dSYM files\n    #    - \"$DWARF_DSYM_FOLDER_PATH\" points to where Xcode stores dSYM bundles for this build.\n    #    - Redirect output to /dev/null to keep logs clean, but capture any error message.\nERROR=$(sentry-cli debug-files upload \\\n\"$DWARF_DSYM_FOLDER_PATH\" --force-foreground 2>&1 >/dev/null)\n\n# ðŸ§­ 5. Check exit status and print warning if upload failed\nif [ ! $? -eq 0 ]; then\necho \"error: sentry-cli - $ERROR\"\nfi\nelse\necho \"error: sentry-cli not installed, download from https://github.com/getsentry/sentry-cli/releases\"\nfi\n";
